package com.amandris.clients.service.vo;import java.io.Serializable;public class State implements Serializable{		private Integer id;	private String  text;	private Integer countryId;	private Country country;		private static final long serialVersionUID = 6526471155622776020L;		public Country getCountry() {		return country;	}	public void setCountry(Country country) {		this.country = country;	}	public Integer getCountryId() {		return countryId;	}	public void setCountryId(Integer countryId) {		this.countryId = countryId;	}	public Integer getId() {		return id;	}	public void setId(Integer id) {		this.id = id;	}	public String getText() {		return text;	}	public void setText(String text) {		this.text = text;	}}